Noticing that $c = 2 - 3i = \sqrt{13} \left( \frac{2}{\sqrt{13}} - \frac{3}{\sqrt{13}} i \right),$ we see that $c$ is a rotation of $\frac{\pi}{4}$ of the complex number $2 - 3i = 2 + (-3)i$ by $\frac{\pi}{4}$ in the counterclockwise direction.  Therefore, $w$ is a rotation of $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$ by $\frac{\pi}{4}$ in the counterclockwise direction.  We can write $z$ as $z = (2 + \sqrt{2}) + (-3 - 3 \sqrt{2})i.$

[asy]
unitsize(0.6 cm);

pair Z, W;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
W = rotate(45,Z)*(Z);

draw(Z--W);

dot("$z$", Z, S);
dot("$w$", W, SE);
label("$\frac{\pi}{4}$", Z + (0.6,-1));
[/asy]

Rotating $z$ by $\frac{\pi}{4}$ in the counterclockwise direction is the same as multiplying $z$ by $e^{\frac{\pi}{4} i} = \cos \frac{\pi}{4} + i \sin \frac{\pi}{4} = \frac{1}{\sqrt{2}} + \frac{1}{\sqrt{2}} i.$  Therefore, $w = z \cdot \left( \frac{1}{\sqrt{2}} + \frac{1}{\sqrt{2}} i \right) = \boxed{1 - 4i}.$

Tātad $n = 7k + 2$ kāda $k \in \mathbb{Z}$. Šis atrodiet, kad $n \equiv 2 \pmod{7}$. Šis atrodiet, kad $n + 2 \equiv 4 \pmod{7}$, $n + 4 \equiv 6 \pmod{7}$, $n + 6 \equiv 1 \pmod{7}$. Šis atrodiet, kad $n + 2$, $n + 4$, $n + 6$ ir par 7 dalīti vienādi no 1, 4, 6. Šis atrodiet, kad $(n + 2)(n + 4)(n + 6)$ tiek dalīts ar 7.  \[
\boxed{7}
